import { Component } from '@angular/core';
import { RouterLink } from '@angular/router';
@Component({
  standalone: true, selector: 'app-navbar', imports: [RouterLink],
  templateUrl: './navbar.component.html', styleUrls: ['./navbar.component.css']
}) export class NavbarComponent {}
<header class="top">
  <div class="brand">⚡ Microgrid UI</div>
  <nav class="nav">
    <a routerLink="/inicio">Inicio</a>
    <a routerLink="/cargar-datos">Cargar Datos</a>
    <a routerLink="/configuracion">Configuración</a>
    <a routerLink="/resultados">Resultados</a>
    <a routerLink="/ayuda">Ayuda</a>
  </nav>
</header>
